import React from 'react';
import { Link } from 'react-router-dom';
import './navBar.css';

function NavBar () {
  return (
    <div className='navBar'>
      <div className="left-side-nav">
        <button href=''>
          <img src='https://seguidores.online/wp-content/uploads/2019/08/dm-en-instagram.png'></img>
        </button>
        <Link to='/channels'>
          <a href=''>Rewrams</a>
        </Link>
      </div>
      <div className='right-side-nav'>
        <Link to='/channels'>
          <button>Channels</button>
        </Link>
        <Link to='/about'>
          <button>About</button>
        </Link>
      </div>
    </div> 
  )
}

export default NavBar;
